class App extends Component {
    constructor(props) {
        super(props);
        this.state = { 'title': 'Hello React' };
    }
    render() {
        return (
            <section className='flex justify-center text-center'>
                <div className='w-1/2'>
                    <div className='my-4'>{this.state.title}</div>
                    <div>
                        <button className='p-1 bg-blue-700 text-white'></button>
                    </div>
                </div>
            </section>
        );
    }
}


export default App;
